import React, { Component, Fragment } from "react";
import { connect } from "react-redux";
import PropTypes from "prop-types";
import {
  getAssignment,
  deleteAssignment,
} from "../../../actions/teacher_framework_actions/create_quizz";
export class GET extends Component {
  static propTypes = {
    assignments: PropTypes.array.isRequired,
    getAssignment: PropTypes.func.isRequired,
    deleteAssignment: PropTypes.func.isRequired,
  };
  //component load then
  componentDidMount() {
    this.props.getAssignment();
  }
  render() {
    return (
      <Fragment>
        <h2>Affective Domain (feelings, attitudes)</h2>
        <table className="table table-stripped">
          <thead>
            <tr>
              <th>ID</th>
              <th>CODE</th>
              <th>DEFINITION</th>
              <th>VERBS</th>
              <th />
            </tr>
          </thead>
          <tbody>
            {this.props.assignments.map((affective) => (
              <tr key={affective.id}>
                <td>{affective.id}</td>
                <td>{affective.code}</td>
                <td>{affective.definition}</td>
                <td>{affective.verbs}</td>
                <td>
                  <button
                    onClick={this.props.deleteAssignment.bind(
                      this,
                      affective.id
                    )}
                    className="btn btn-danger btn-sm"
                  >
                    Delete
                  </button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </Fragment>
    );
  }
}

//state of redux
const mapStateToProps = (state) => ({
  assignments: state.assignments.assignments,
});
export default connect(mapStateToProps, { getAssignment, deleteAssignment })(
  GET
);
